        align-items: center;

        display: flex;
        flex-direction:column;

        align-items: center;

    }

        color: rgba(0, 0, 0, 0.80);

        font-size: 35px;
        font-style: normal;
        font-weight: 400;
        line-height: normal;
        text-align: center;
    }
    .back-btn{
        border-radius: 40px;
        background: #00A8E6;
        color: #FFF;
        text-align: center;
        font-family: "Open Sans";
        font-size: 16px;
        font-style: normal;
        font-weight: 700;
        line-height: normal;
        text-transform: capitalize;
        text-decoration: none;
        border: none;
        padding: 16px 32px;
        cursor: pointer;
    }
  
</style>
